import React from 'react';
function Projects() {
  return (
    <div>
      <h2>Projects</h2>
      <ul>
        <li><strong>Project X</strong> – built with React and Node</li>
        <li><strong>Portfolio Site</strong> – this very site!</li>
      </ul>
    </div>
  );
}
export default Projects;
